window.bookSummaryJSON = "<p><b><i>Amidst Shadows and Secrets, a Deadly Hunt Begins.</i></b><br> <b><i>Six kids walked into the woods, but only five walked out...</i></b><br> <br> Eighteen-year-old Liz Turner's vanishing act sets off a relentless storm of secrets and suspicions. Her tight-knit group of friends, on the verge of starting their college journey, becomes fractured as they grapple with the puzzling nature of her disappearance. Without a body to be found, the police investigation stalls, leaving the case enshrouded in uncertainty.<br> <br> Maddie Castle, tormented by personal tragedy. In the depth of her despair, the vanishing of Daisy Miller, her boyfriend's sister-in-law, stirs old wounds and ignites a flicker of hope. Desperate for answers and redemption, Maddie seeks alliance with Detective Ashley Harper, the relentless investigator assigned to the Liz Turner case.<br> <br> But their partnership comes at a cost. Maddie, once a respected law enforcement officer, must now rely on her instincts and her loyal K9 partner, Tempest, to navigate the treacherous terrain of this perplexing enigma. Harper's bargain is simple: unravel the threads of Liz Turner's life in exchange for assistance in solving Daisy's disappearance.<br> <br> As they plunge deeper into the heart of darkness, Maddie and Harper find themselves entangled in a web of danger, deceit, and deadly adversaries. From the eerie depths of the Pennsylvania wilderness to the clandestine world of hidden foes, they discover that every step taken toward the truth could also lead them closer to their own demise.<br> <br> Get ready for a rollercoaster ride of suspense in <i>Vanished Trails</i>. This electrifying crime action thriller will keep you on the edge of your seat, listening late into the night. Can Maddie and Harper survive the relentless pursuit of the truth, or will they become mere shadows lost among the twisted trails?</p>"; 
